import React from "react";
import { Switch, Route } from "react-router-dom/cjs/react-router-dom";
import Header from "./Header";
import Home from "./components/Home";

function App() {
  return (
    <>
      <Header />
      <Switch>
        <Route exact path="/" render={() => <Home />} />
        <Route exact path="/" render={() => <Home />} />
      </Switch>
    </>
  );
}

export default App;
